import styled from 'styled-components';

export const WinningNumberFormWrapper = styled.form`
  .input-label {
    display: inline-block;
    width: 100%;
    text-align: center;
    margin-bottom: 1.25rem;
  }

  .input-caption {
    margin-top: 0;
    margin-bottom: 0.75rem;
    text-align: center;
  }

  .winning-number-input-wrapper {
    margin-bottom: 1rem;
  }
`;
